const express = require('express');
const path = require('path');
const app = express();
const port = 8080;

// Serve static mock HTML files
app.use(express.static(path.join(__dirname, 'public')));

// Start server
app.listen(port, () => {
  console.log(`Mock server running at http://localhost:${port}`);
});
